import React, {Component} from 'react';
import {ListItem} from '../style';
class List extends Component {
    render(){
        return (
            <div>
                <ListItem>
                    <img src="https://upload-images.jianshu.io/upload_images/10472974-184bbe1cd4d6ea1b.jpeg?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240"></img>
                    <ListInfo>
                        <h3>请记住杨绛先生的这4句话（深度文字）</h3>
                        <p></p>
                    </ListInfo>
                </ListItem>
            </div>
        )
    }
}

export default List;
